using mobileapp.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace mobileapp.Data
{
    public static class AnimalRepository
    {
        public static event Action? AnimalsUpdated;
        private static List<Animal> Animals = new()
        {
            new Animal()
            {
                Id= Guid.NewGuid(),
                Name = "Peacock",
                Description = "A peacock is a shiny blue bird who fans out his large colorful iridescent tail feathers, especially when he's flirting with the peahens. A peacock is a male peafowl. A male peacock is more flamboyant than hisfemale counterpart — he's the one with those long brilliant tail feathers marked with eye-like designs.",
                Category = AnimalCategory.Omnivore,
                Image="data:image/jpeg;base64,"
            },
            new Animal()
            {
                Id = Guid.NewGuid(),
                Name= "Zebra",
                Category = AnimalCategory.Herbivore,
                Description ="Zebras are African equines with distinctive black-and-white striped coats. There are three living species: the Grévy's zebra, plains zebra, and the mountain zebra. Zebras share the genus Equus with horses and asses, the three groups being the only living members of the family Equidae.",
                Image="data:image/jpeg;base64,"
            },
            new Animal()
            {
                Id = Guid.NewGuid(),
                Name="Tiger",
                Category = AnimalCategory.Carnivore,
                Description = "The tiger is the largest living cat species and a member of the genus Panthera.It is most recognisable for its dark vertical stripes on orange fur with a white underside. An apex predator, it primarily preys on ungulates, such as deer and wild boar. They are one of the fastest Animals.",
                Image="data:image/jpeg;base64,"
            }
        };

        public static List<Animal> GetAnimals()
        {
            return new(Animals);
        }

        public static Animal GetAnimal(Guid id)
        {
            return Animals.FirstOrDefault(animal => animal.Id == id);
        }

        public static void AddAnimal(Animal animal)
        {
            animal.Id = Guid.NewGuid();
            Animals.Add(animal);
            AnimalsUpdated?.Invoke();
        }

        public static void UpdateAnimal(Animal animal)
        {
            // find the animal 
            var index = Animals.FindIndex(a => a.Id == animal.Id);
            if (index != -1)
            {
                Animals[index] = animal;
                AnimalsUpdated?.Invoke(); // notify
            }
        }

        public static void DeleteAnimal(Guid id)
        {
            // find the animal 
            var animal = GetAnimal(id);
            if (animal is not null)
            {
                Animals.Remove(animal); 
                AnimalsUpdated?.Invoke();
            }
        }

        public static List<Animal> Search(String searchValue)
        {
            // search on name first 
            List<Animal> Animals = GetAnimals().Where(animal => animal.Name.Contains(searchValue, StringComparison.OrdinalIgnoreCase)).ToList();

            if (Animals.Count <= 0)
            {
                // search on category 
                Animals = GetAnimals().Where(animal => animal.Category.ToString().Contains(searchValue, StringComparison.OrdinalIgnoreCase)).ToList();
            }
            if (Animals.Count <= 0)
            {            // lastly search on description
                Animals = GetAnimals().Where(animal => animal.Description.Contains(searchValue, StringComparison.OrdinalIgnoreCase)).ToList();

            }
            return new(Animals);
        }
    }
}
